Short Product Description:
What it is:
The first iconic Lolita Lempicka fragrance reveals the origin of romance, where everything begins. Its aroma of licorice flower, with sensual, intoxicating notes of spice, acts as a true invitation to travel and passion.Mon Premier Parfum makes her mark with a timeless, delectable nectar, an ode to femininity that seduces immediately, intensely, eternally.

Notes:
Top Notes - Licorice;
Heart Notes - Cherry, Violet;
Base Notes - Cistus Labdanum

