What is It:
Lolita Lempicka captures the essence of the forbidden fruit in a greedy and addictive fragrance, subject to temptation.The perfect blend of cherry and cocoa in a musky base note sounds like an obvious hymn to feminity, claimed with insolence. It is the taste of the lips that have just chew a cherry dipped in black chocolate, the sensation of a kiss, not that innocent and full of voluptuousness.

Notes:
Top Notes - Cherry;
Heart Notes - Iris, cocoa, Angelica;
Base Notes - Cashmeran

