What Is It:
Floral and fruity, So Sweet is the captivating fragrance of a playful and seductive woman. Its musky and greedy notes enhanced with chantilly make the perfume arousing and dazzling, which surprises by its audacity.True ally of feminity, it leaves on the skin the sweet imprint of a stolen kiss.

Notes:
Top Notes - Cherry, Raspberry;
Heart Notes - Iris, Angelica;
Base Notes - Musk chantilly, Cashmeran
